import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import MainNavbar from "./components/navbars/NavbarMain";
import BookingsTable from "./components/tables/BookingsTable";
import NotFoundPage from "./pages/404NotFound";
import About from "./pages/about";
import AdminLayout from "./pages/admin/AdminLayout";
import LoginPage from "./pages/authentication/login";
import RegisterPage from "./pages/authentication/register";
import Contact from "./pages/contact";
import DummyPage from "./pages/dummy";
import Home from "./pages/home";
import Services from "./pages/services";
import UserLayout from "./pages/user/UserLayout";
import { useAuthContext } from "./components/hooks/useAuthContext";
import Searchv2 from "./components/searchv2";

function App() {
  const { user } = useAuthContext();

  // console.log(user.isAdmin);
  // const isAdmin = user.isAdmin;
  // console.log(isAdmin);

  return (
    <>
     
      <Router>
        {/* <MainNavbar /> */}
        <Routes>
          <Route element={<MainNavbar />}>
            <Route exact path="/" element={<Home />} />
            <Route path="/services" element={<Services />} />
            <Route path="/about-us" element={<About />} />
            <Route path="/contact-us" element={<Contact />} />
            <Route
              path="/login"
              element={!user ? <LoginPage /> : <Navigate to="/" />}
            />
            <Route
              path="/register"
              element={!user ? <RegisterPage /> : <Navigate to="/" />}
            />
            <Route
              path="/search"
              element={!user ? <Searchv2 /> : <Navigate to="/" />}
            />
            <Route path="*" element={<NotFoundPage />} />
            {/* <Route
              path="/login"
              element={!user ? <LoginPage /> : <Navigate to="/account/user/" />}
            /> */}

            {/* <Route
              path="/register"
              element={!user ? <RegisterPage /> : <Navigate to="/" />}
            /> */}
            <Route path="/dummy" element={<DummyPage />} />
          </Route>

          {/* <Route
            path="/account/admin/*"
            element={
              user && user.isAdmin === true ? <AdminLayout /> : <AdminLayout />
            }
          /> */}

          <Route
            path="/account/*"
            element={
              user && user.isAdmin === false ? <UserLayout /> : <AdminLayout />
            }
          />
          <Route path="/account/user/booking" element={<BookingsTable />} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
